private void munmap(MappedByteBuffer buffer) {
  if (CleanerUtil.UNMAP_SUPPORTED) {
    try {
      CleanerUtil.getCleaner().freeBuffer(buffer);
    } catch (IOException e) {
      LOG.warn("Failed to unmap the buffer", e);
    }
  } else {
    LOG.trace(CleanerUtil.UNMAP_NOT_SUPPORTED_REASON);
  }
}
